--
-- Table structure for table `sys_parameters`
--

DROP TABLE IF EXISTS `sys_parameters`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `sys_parameters` (
  `module_id` int(11) NOT NULL,
  `parameter_id` int(11) NOT NULL,
  `parameter_code` varchar(100) NOT NULL COMMENT '参数代码',
  `validation_type` varchar(100) NOT NULL COMMENT '验证类型',
  `description` varchar(2000) NOT NULL COMMENT '参数名称',
  `user_changeable_flag` varchar(1) NOT NULL COMMENT '用户可更新',
  `user_visible_flag` varchar(1) NOT NULL COMMENT '用户可查看',
  `system_enabled_flag` varchar(1) NOT NULL COMMENT '参数级别：全局',
  `role_enabled_flag` varchar(1) NOT NULL COMMENT '参数级别：角色',
  `user_enabled_flag` varchar(1) NOT NULL COMMENT '参数级别：用户',
  `company_enabled_flag` varchar(1) NOT NULL COMMENT '公司',
  `sql_validation` varchar(2000) DEFAULT NULL COMMENT 'SQL验证',
  `start_date_active` datetime DEFAULT NULL COMMENT '有效日期从',
  `end_date_active` datetime DEFAULT NULL COMMENT '有效日期至',
  `parameter_name_id` int(11) DEFAULT NULL,
  `encrypt_value_flag` varchar(1) DEFAULT NULL COMMENT '加密数据',
  `app_enabled_flag` varchar(1) DEFAULT NULL COMMENT 'APP 启用',
  `last_update_date` datetime NOT NULL COMMENT '最近更新日期',
  `last_updated_by` int(11) NOT NULL COMMENT '最近更新用户',
  `creation_date` datetime NOT NULL COMMENT '创建日期',
  `created_by` int(11) NOT NULL COMMENT '创建用户',
  PRIMARY KEY (`parameter_id`),
  UNIQUE KEY `parameter_code` (`parameter_code`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='SYS_PARAMETERS';
/*!40101 SET character_set_client = @saved_cs_client */;

